import React from "react";
import { component } from "react-redux";

class News extends React.PureComponent {
    render() {
        return (
        <>
             <div class="title">News</div>
             <div className="news">
                <img src="./images/news.png" alt="some news here" class="news-item" />
                <img src="./images/news.png" alt="some news here" class="news-item" />
                <img src="./images/news.png" alt="some news here" class="news-item" />
            </div>
        </>
            )
    }
}
export default News;
